import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import Header from './Components/Common/Header';


function HomeScreen() {
  return (
    <View style={{flex: 1}}>
    <Text>Hello</Text>
    </View>
  );
}

function LogoTitle() {
  return (
  <Image  source={require('./image/test.svg')} style={{height:50, width:200,resizeMode:'contain'}} /> 
  ); 
}

function HeaderR() {
  return ( <Image  source={require('./image/test.svg')} style={{height:20, width:30,resizeMode:'contain'}} /> );

}
function HeaderL(){
  return(<Image source={require('./image/test.svg')} style={{height:20, width: 30,justifyContent:'center', alignItems:'center',  resizeMode:'contain'}}/> );

}

const Stack = createStackNavigator();

function App() {
  return (
    <View style={styles.container}>
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" options={{
          headerStyle: { backgroundColor: '#101152'},
          headerTitle: props => <LogoTitle {...props}/>,
          headerTitleAlign: 'center',
          headerRight: ()=> <HeaderR/>,
          headerLeftContainerStyle: {paddingLeft: 10},
          headerRightContainerStyle: {paddingRight: 10},
          headerLeft: ()=> <HeaderL />
        }} component={HomeScreen} />
      </Stack.Navigator>
    </NavigationContainer>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default App;
